import React, { PureComponent } from 'react';
import {
  BarChart, Bar, Cell, XAxis, YAxis, CartesianGrid, Tooltip, Legend,ResponsiveContainer
} from 'recharts';

const data = [
    {
        name: 'Less than high school graduate', UnitedStates: 590, Monroe: 800, amt: 1400,
    },
    {
        name: 'high school graduate', UnitedStates: 868, Monroe: 967, amt: 1506,
    },
    {
        name: ' Associates degree', UnitedStates: 1397, Monroe: 1098, amt: 989,
    },
    {
        name: '35-64', UnitedStates: 1480, Monroe: 1200, amt: 1228,
    },
    {
        name: '<64', UnitedStates: 1520, Monroe: 1108, amt: 1100,
    },
];

export default class Example extends PureComponent {
  static jsfiddleUrl = 'https://jsfiddle.net/alidingling/90v76x08/';

  render() {
    return (
        <div style={{ width: '100%', height: 400 }}>
        <ResponsiveContainer>
      <BarChart
        width={500}
        height={300}
        data={data}
        margin={{
          top: 20, right: 30, left: 20, bottom: 5,
        }}
      >
        <CartesianGrid strokeDasharray="3 3" />
        <XAxis dataKey="name" />
        <YAxis />
        <Tooltip />
        <Legend />
        <Bar dataKey="Monroe" stackId="a" fill="#8884d8" />
        <Bar dataKey="UnitedStates" stackId="a" fill="#82ca9d" />
      </BarChart>
      </ResponsiveContainer>
      </div>
    );
  }
}
